import React from 'react';
import {View, Text, TouchableOpacity} from 'react-native';
import Contador from '../../components/Contador/Contador'

function Home(){
    return(
        <View>
            <Text>Hola Mundo</Text>
            <Contador/>
        </View>
    )
}

export default Home
